import{_ as a,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"ALTER PROTOCOL","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_PROTOCOL.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_PROTOCOL.md"}'),n={name:"docs/7x/ref_guide/sql_commands/ALTER_PROTOCOL.md"};function i(l,e,r,c,p,d){return o(),t("div",null,e[0]||(e[0]=[s(`<h1 id="alter-protocol" tabindex="-1">ALTER PROTOCOL <a class="header-anchor" href="#alter-protocol" aria-label="Permalink to &quot;ALTER PROTOCOL&quot;">​</a></h1><p>Changes the definition of a protocol.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER PROTOCOL &lt;name&gt; RENAME TO &lt;newname&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER PROTOCOL &lt;name&gt; OWNER TO &lt;newowner&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER PROTOCOL</code> changes the definition of a protocol. Only the protocol name or owner can be altered.</p><p>You must own the protocol to use <code>ALTER PROTOCOL</code>. To alter the owner, you must also be a direct or indirect member of the new owning role, and that role must have <code>CREATE</code> privilege on schema of the protocol.</p><p>These restrictions are in place to ensure that altering the owner only makes changes that could by made by dropping and recreating the protocol. Note that a superuser can alter ownership of any protocol.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name (optionally schema-qualified) of an existing protocol.</p><p>newname : The new name of the protocol.</p><p>newowner : The new owner of the protocol.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To rename the protocol <code>GPDBauth</code> to <code>GPDB_authentication</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER PROTOCOL GPDBauth RENAME TO GPDB_authentication;</span></span></code></pre></div><p>To change the owner of the <code>GPDB_authentication</code> protocol to <code>joe</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER PROTOCOL GPDB_authentication OWNER TO joe;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>ALTER PROTOCOL</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="seea"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;seea&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_EXTERNAL_TABLE.html">CREATE EXTERNAL TABLE</a>, <a href="./CREATE_PROTOCOL.html">CREATE PROTOCOL</a>, <a href="./DROP_PROTOCOL.html">DROP PROTOCOL</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,22)]))}const u=a(n,[["render",i]]);export{m as __pageData,u as default};
